//import './index.css';
import Calendar from './Components/Calendar'
import Tempcal from './Components/temp'
import { Navbar, Nav } from 'rsuite';


function App() {
  return (
    <div className="App">
      <Navbar appearance='subtle' color='green'>
        <Navbar.Brand href="#">LOGO</Navbar.Brand>
        <Nav color='green'>
          <Nav.Item eventKey="1">Kezdőlap</Nav.Item>
          <Nav.Item eventKey="2">Rólam</Nav.Item>
          <Nav.Item eventKey="3">Időpontfoglalás</Nav.Item>
        </Nav>
        <Nav pullRight>
          <Nav.Item >Bejelentkezés</Nav.Item>
        </Nav>
    </Navbar>
      <Tempcal/>
    </div>
  );
}


export default App;
